import React from "react";
import Inventory from "./components/Inventory";
function App() {
  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>InventoryHub</h1>
      <Inventory />
    </div>
  );
}

export default App;
